import React from "react";
import {
  Box,
  Button,
  Typography,
  Select,
  MenuItem,
} from "@mui/material";
import HomeIcon from "@mui/icons-material/Home";
import { useNavigate, useParams } from "react-router-dom";

interface RouteParams {
  [key: string]: string | undefined;
  championName?: string;
}

const ChampionDetails: React.FC = () => {
  const { championName } = useParams<RouteParams>();
  const navigate = useNavigate();
  return (
    <Box sx={{ p: 2 }}>
      {/* Ligne supérieure : Bouton Home à gauche et barre de recherche centrée */}
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          mb: 2,
        }}
      >
        {/* Bouton Home */}
        <Button
          variant="outlined"
          startIcon={<HomeIcon />}
          onClick={() => navigate("/")}
        >
          Home
        </Button>
        {/* Barre de recherche */}
        <input
          type="text"
          placeholder="Rechercher un champion..."
          style={{
            width: "60%",
            padding: "8px",
            borderRadius: "4px",
            border: "1px solid #ccc",
          }}
        />
      </Box>

      {/* Bandeau horizontal avec le titre (nom du champion), statistiques et sélecteur d'elo */}
      <Box
        sx={{
          my: 2,
          p: 1,
          backgroundColor: "#f0f0f0",
          borderRadius: "4px",
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
        }}
      >
        <Typography variant="h5">{championName?.toLocaleUpperCase()}</Typography>
        <Typography variant="body1">Winrate: 52%</Typography>
        <Typography variant="body1">Pickrate: 12%</Typography>
        <Typography variant="body1">Banrate: 6%</Typography>
        <Select defaultValue="bronze" size="small">
          <MenuItem value="bronze">Bronze</MenuItem>
          <MenuItem value="silver">Silver</MenuItem>
          <MenuItem value="gold">Gold</MenuItem>
          <MenuItem value="challenger">Challenger</MenuItem>
        </Select>
      </Box>

      {/* Bandeau de boutons de navigation */}
      <Box
        sx={{
          display: "flex",
          gap: "8px",
          mb: 2,
        }}
      >
        {["Overview", "Items", "Masteries", "Sums", "Spells", "Stats"].map(
          (label) => (
            <Button key={label} variant="text">
              {label}
            </Button>
          )
        )}
      </Box>

      {/* Zone principale : deux grandes colonnes */}
      <Box sx={{ display: "flex", gap: "16px" }}>
        {/* Colonne de gauche */}
        <Box
          sx={{
            flex: "1",
            display: "flex",
            flexDirection: "column",
            gap: "16px",
          }}
        >
          {/* Image verticale du champion */}
          <Box
            component="img"
            src="/Garen.jpg"
            alt="Champion"
            sx={{
              width: "100%",
              height: "auto",
              border: "1px solid #ccc",
              borderRadius: "4px",
            }}
          />
        </Box>

        {/* Colonne de droite */}
        <Box sx={{ flex: "3" }}>
          {/* Première rangée */}
          <Box
            sx={{
              display: "flex",
              gap: "16px",
              mb: 2,
            }}
          >
            <Box
              sx={{
                flex: "2",
                border: "1px solid #ccc",
                p: 1,
                minHeight: "300px",
              }}
            >
              <Typography variant="subtitle1">
                Arbre de maîtrises principales
              </Typography>
              {/* Contenu à implémenter */}
            </Box>
            <Box
              sx={{
                flex: "1",
                display: "flex",
                flexDirection: "column",
                gap: "16px",
              }}
            >
              <Box
                sx={{
                  border: "1px solid #ccc",
                  p: 1,
                  minHeight: "140px",
                }}
              >
                <Typography variant="subtitle1">
                  Arbre de maîtrises secondaires
                </Typography>
                {/* Contenu à implémenter */}
              </Box>
              <Box
                sx={{
                  border: "1px solid #ccc",
                  p: 1,
                  minHeight: "100px",
                }}
              >
                <Typography variant="subtitle1">Spell Order</Typography>
                {/* Contenu à implémenter */}
              </Box>
            </Box>
          </Box>

          {/* Deuxième rangée */}
          <Box
            sx={{
              display: "flex",
              gap: "16px",
            }}
          >
            <Box
              sx={{
                flex: "1",
                border: "1px solid #ccc",
                p: 1,
              }}
            >
              <Typography variant="subtitle1">Runes</Typography>
              {/* Contenu à implémenter */}
            </Box>
            <Box
              sx={{
                flex: "1",
                border: "1px solid #ccc",
                p: 1,
              }}
            >
              <Typography variant="subtitle1">Sorts d'invocateur</Typography>
              {/* Contenu à implémenter */}
            </Box>
            <Box
              sx={{
                flex: "2",
                display: "flex",
                flexDirection: "column",
                gap: "16px",
              }}
            >
              <Box
                sx={{
                  border: "1px solid #ccc",
                  p: 1,
                }}
              >
                <Typography variant="subtitle1">Objets de départ</Typography>
                {/* Contenu à implémenter */}
              </Box>
              <Box
                sx={{
                  border: "1px solid #ccc",
                  p: 1,
                }}
              >
                <Typography variant="subtitle1">Core Build</Typography>
                {/* Contenu à implémenter */}
              </Box>
              <Box
                sx={{
                  border: "1px solid #ccc",
                  p: 1,
                }}
              >
                <Typography variant="subtitle1">Late Game Items</Typography>
                {/* Contenu à implémenter */}
              </Box>
            </Box>
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default ChampionDetails;
